import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';


const MainWindow = styled.div`
  width: 500px;
  margin: 0 auto;
  margin-top: 180px;
  display: flex;
  background-color: #fa6;
`

const SwitchSignIn = styled.div`
  width: 100%;
  height: 60px;
  display: flex;
  align-items: center;
  a{
    text-decoration: none;
    color: #787d85;
    text-transform: uppercase;
    letter-spacing: 1px;
    font-size: 11px;
    margin-left: 40px;
  }
`

const SignIn = () => {
  return (
    <>
      <p>Ссылка сработала, заебись</p>
      <Link to='/Dashboard'>Домой</Link>
      <MainWindow> 
        <SwitchSignIn>
          <a href="#">Войти</a>
          <a href="#">Создать учётную запись</a>
        </SwitchSignIn>
      </MainWindow>
    </>
  );
}

export default SignIn;
